import React from "react";

export default class StateDemoFirstCC extends React.Component
{
    constructor(props) 
    {
        super(props);
        this.state = {
            ISBN: props.ISBN,
            Title: props.Title,
            Price: props.Price
        };
    }

    render()
    {
        return(
            <>
                <div> <h1>Book Details</h1>
                <h4>Book ISBN = {this.ISBN}</h4>
                <h4>Book Title = {this.Title}</h4>
                <h4>Book Price = {this.Price}</h4>

                </div>
            </>
        )
    }
}
